  # Find the military force related to a societal event and military conflict
  ?event1 dbo:militaryForce ?militaryForce1 ;
          a dbo:SocietalEvent ;
          a dbo:MilitaryConflict ;
          dbo:participant ?person .

  # Find the awardee of the British South Africa Company Medal
  ?awardee dbo:award dbr:British_South_Africa_Company_Medal .

  # Find the military force related to the war that is an event, military conflict, and societal event
  ?event2 dbo:militaryForce ?militaryForce2 ;
          a dbo:Event ;
          a dbo:MilitaryConflict ;
          a dbo:SocietalEvent ;
          dbo:participant ?awardee .
}

